import React from 'react'
import { Box, Container, Button} from "@chakra-ui/react";

const Home = () => {
  return (
    <section>
    <Box
      as="section"
      w={['80%', '100%', '100%']}
      top={30}
      left={0}
      right={0}
      margin='0 auto'
      height={700}
      bg='gray'
      alignContent='center'
      justifyContent='center'
      justifyItems='center'
      alignItems='center'
      justifySelf='center'
      alignSelf='center'
      >
      <Container maxWidth="1280px">
        <button type="button" id="signup-btn" class="btn btn-primary btn-lg px-4 me-md-2">Sign Up</button>
        <button type="button" id="login-btn" class="btn btn-outline-secondary btn-lg px-4">Log In</button>
        <Button colorScheme='blue'>Sign Up</Button>
      </Container>
      </Box>
      </section>
  )
}

export default Home
